import React from "react";
import * as C from "./styles";

const Header: React.FC = () => {
    return (
        <C.Container>
            <C.Header>
                <C.Title>Controle Financeiro</C.Title>
            </C.Header>
        </C.Container>
    );
};

export default Header;
